// Unix Signal manager:
void interrupt_signal(int sig)  
{                               
  stack_print(top_context);     
  print_string("User interrupt.\n"); 
  die_with_code(1);                     
}                                       

void push_first(_____CONTEXT *path,unsigned long code)
{ 
  path->back  = top_context;
  path->code  = code;
  top_context = path;
} 
  
void push(_____CONTEXT *path,unsigned long code)
{ 
  path->code  = code;
  top_context = path;
} 
  
void stack_print(_____CONTEXT *up)      
{ _____CONTEXT *back,*next;             
  int j;	                              
  next = (void *)0;                          
  while (up != (void *)0) {                  
    back = up -> back;                       
    up -> back = next;                       
    next = up;                               
    up = back;                               
  };                                         
  print_string("\n============== BOTTOM ==============\n"); 
  while (next != (void *)0) {                
    print_string("Line #");                           
    print_integer(__src[next->code].pos >> 17);         
    print_string(" Column #");                        
    print_integer((__src[next->code].pos >> 9) & 0xFF); 
    print_string(" in ");                             
    print_string(trace[__src[next->code].pos & 0x1FF]); 
    print_string(".\n");                             
 if ((__src[next->code].pos & 0x1FF) != 0) { 
    print_string(__src[next->code].line);               
    print_char('\n');                                  
    for (j=0;j < ((__src[next->code].pos >> 9) & 0xFF);j++) {
      if (__src[next->code].line[j]=='\t') print_char('\t');
      else print_char(' ');
    };                                                  
    print_char('^');    
    print_char('\n');   
 }; 
    next = next -> back;                     
  };                                         
  print_string("================ TOP ===============\n"); 
  top_context = (void *)0;                   
}                                            
 
void print_integer(unsigned short n) 
{ unsigned short val;                
  char car;                          
  car = (n % 10) + '0';              
  val = n / 10;                      
  if (val != 0) print_integer(val);  
  print_char(car);                   
} 

